// App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import PopisBodova from './PopisBodova'; // Ako je PopisBodova u istom direktoriju

function App() {
  return (
    <Router>
      <div>
        <h1>Aplikacija za Lov</h1>
        {/* Link komponenta se koristi za navigaciju. */}
        {/* Umjesto <a href="/popis-bodova"> koristimo <Link to="/popis-bodova"> */}
        <Link to="/popis-bodova">
          <button>Bodovi</button>
        </Link>
        {/* Routes komponenta zamijenila je Switch komponentu u react-router-dom v6 */}
        <Routes>
          <Route path="/popis-bodova" element={<PopisBodova />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
